import React from "react";
import Button from "./Button";

const Home = () => {
    return (
        <main>
            <h1>Home</h1>
            <p>Register as a:</p>
            <Button buttonText={"Professional"} />
            <Button buttonText={"Patient"} />
            <Button buttonText={"Doctor"} />
        </main>
    );
};

export default Home;
